import { jsPDF } from 'jspdf';

const font =
  '';
const callAddFont = function () {
  this.addFileToVFS('AbhayaLibre-Regular-normal.ttf', font);
  this.addFont('AbhayaLibre-Regular-normal.ttf', 'AbhayaLibre-Regular', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont]);
